    - ID: "625f32a7-8b24-4b35-8f6f-1464da77bc40"
      Hint: Content
      Value: "<p>Zo&euml;con originated insect growth regulator (IGR) technology over 50 years ago, and we have been providing innovative solutions to pest management professionals ever since. Our product portfolio is designed to enable broad-spectrum, long-term residual control with a range of IGRs, adulticides, botanicals, synergists and combination products. We&rsquo;re committed to providing the tools professionals need to manage insect populations, prevent future infestations and reduce callbacks.</p>"
